import React from 'react'

export default function WorkoutPage(props) {


const opneWorkout = () =>{}


  return (
    <button style={{border: "1px solid green", margin:"5px"}} onClick ={opneWorkout} disabled ={props.workouts.isDone}>
        <h4>Workout N.O {props.workouts.wNumber}</h4>
        <p>{props.workouts.km} KM </p>
        </button>
  )
}
